import React from "react";
import ReactDOM from "react-dom/client";

const root = ReactDOM.createRoot(document.getElementById("root"));

function Emma() {
  let name = prompt("Escrbi tu nombre: ");
  if (name == "Marco" || "marco" || "fini") {
    return <h1>Emma te va a dar bola</h1>;
  } else if (name == "salo" || "Salo" || "Agustin") {
    return <h1>Jenna te va a dar bola</h1>;
  }
  return <h1>{name}</h1>;
}
root.render(
  <div>
    <Emma />
  </div>
);
